import React, { useEffect } from 'react';
import { Fragment } from 'react';
import { FcLike as Like, FcLikePlaceholder as Dislike} from 'react-icons/fc';

const Ratings = () => {
  const isLiked = async()=>{
    try {
      const query = await fetch('http://localhost:5000/isliked/1',{
        method : 'GET',
        headers : {token : localStorage.token}
      });
      const response = await query.json();
      if(response === true){
        return <Like />
      }
      else {
        return <Dislike />
      }
    } catch (error) {
      console.log(error);
      return(
        <Fragment>
          <h1>Error</h1>
        </Fragment>
      );
    }
  };
  useEffect(()=>{
    isLiked();
  },[]);
};


export default Ratings;
